import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import AdminLogin from "./admin/pages/login";
import MainDashboard from "./admin/pages/dashboard";
import AssetsDashboard from "./admin/pages/asset-list";
import RegisterAsset from "./admin/pages/asset-add";
import TransactionsOffline from "./sample";

function App() {
  return (
    <Router>
      <Routes>
        {/* Add your routes here */}
        <Route path="/" element={<div>Home Page</div>} />
        <Route path="/login" element={<AdminLogin />} />
        <Route path="/dashboard" element={<MainDashboard />} />
        <Route path="/assets/list" element={<AssetsDashboard />} />
        <Route path="/assets/add" element={<RegisterAsset />} />
        <Route path="/trans" element={<TransactionsOffline />} />
      </Routes>
    </Router>
  );
}

export default App;
